  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115592 includes biological,
  chemical, discrete sample, physical and profile data collected from HEALY in the
  Arctic Ocean, Beaufort Sea and Bering Sea from 2004-05-15 to 2004-06-23 and retrieved
  during cruise CARINA/32H120040515. These data include ALKALINITY, AMMONIUM, CHLOROPHYLL
  A, Chromophoric Dissolved Organic Matter (CDOM), DISSOLVED INORGANIC CARBON, DISSOLVED
  ORGANIC CARBON, DISSOLVED OXYGEN, FLUORESCENCE, HYDROSTATIC PRESSURE, NITRATE, NITRITE,
  PHAEOPHYTIN, PHOSPHATE, PHOTOSYNTHETIC ACTIVE RADIATION (PAR), Potential temperature
  (theta), SALINITY, SILICATE, Total Dissolved Nitrogen (TDN), UREA and WATER TEMPERATURE.
  The instruments used to collect these data include CTD, PAR Sensor and bottle. These
  data were collected by J. Swift of Scripps Institution of Oceanography and L.. Codispoti
  of University of Maryland; Center for Environmental Science; Horn Point Laboratory
  as part of the CARINA/32H120040515 data set.nnThe CARINA (CARbon dioxide IN the
  Atlantic Ocean) data synthesis project is an international collaborative effort
  of the EU IP CARBOOCEAN, and U.S. partners. It has produced a merged internally
  consistent data set of open ocean subsurface measurements for biogeochemical investigations,
  in particular, studies involving the carbon system. The original focus area was
  the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
  now includes data from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\":
